import React from "react";
import Slider from "react-slick";
const Testimonial = () => {
  return (
    <Slider>
      <div className="testimontial py-4 px-3">
        <p>
          Lorem ipsum dolor sit amet consectetur adipisicing elit. Explicabo
          nemo ad dolorem non! Unde, commodi ratione quae quidem repudiandae ab.
          Odio enim eveniet facilis iusto nobis voluptas animi libero
          consequatur.
        </p>
      </div>
    </Slider>
  );
};

export default Testimonial;
